import React, { useState } from 'react';
function Slider() {
  const [range, changedRange] = useState(12);

  return (
    <React.Fragment>
      <input
        onChange={e => changedRange(e.target.value)}
        type="range"
        min={0}
        max={600}
        step="1"
        defaultValue={range}
      />
      <p data-current-price>{range}</p>
      <p data-max-range>{600}</p>
    </React.Fragment>
  );
}
export default Slider;
